    const lon = "-122.3486";

    useEffect(() => {
        const getMap = async () => {
            const response = await axios.get(`https://api.mapbox.com/styles/v1/ideviotllc/streets-v12/static/[${lat},${lon}]/400x400?access_token=${mapboxAccessToken}`);

            setMap(response.data);
        }
        console.log("I'm getting the map")
        getMap();
    }, [])

// console.log(map)

